require 'spec_helper'
require_relative '../lib/google_mosaic_gallery_parser'

RSpec.describe GoogleMosaicGalleryParser do
  describe 'parse alternative Scenario 1 - Van Gogh Artwork (fixtures/van_gogh.html)' do
    let(:sample_html) do
      read_fixture('van_gogh.html')
    end

    subject(:parser) { described_class.new(sample_html) }
    
    let(:result) { parser.extract_artwork }

    it 'returns artworks' do
      expect(result).to be_an(Array)
      
    end

    it 'artwork contains all required fields' do
      first_artwork = result.first
      
      expect(first_artwork).to have_key(:name)
      expect(first_artwork).to have_key(:extensions)
      expect(first_artwork).to have_key(:link)
      expect(first_artwork).to have_key(:image)
    end

    it 'returns first artworks with title Portrait of Adeline Ravoux and all correct fields' do
      first_artwork = result.first
      
      expect(first_artwork[:name]).to eq('The Starry Night')
      expect(first_artwork[:extensions]).to eq(['1889'])
      expect(first_artwork[:link]).to eq('https://www.google.com/search?sca_esv=8a18c8f55351fc4a&sxsrf=ADLYWIJBe-2UhUBH0VuQ3QosT0SRFM1NBg:1734051631580&q=The+Starry+Night&stick=H4sIAAAAAAAAAONgFuLQz9U3MI_PNVLiBLFMzC3jC7WUspOt9Msyi0sTc-ITi0qQmJnFJVbl-UXZxYtYBUIyUhWCSxKLiioV_DLTM0oAdKX0-E4AAAA&sa=X&ved=2ahUKEwiS2ZbcxaOKAxXNG9AFHS0SBP0Qtq8DegQINBAD')
      expect(first_artwork[:image]).to eq('data:image/jpeg;base64,')
    end
  end

  describe 'parse alternative Scenario 2 - Van Gogh Artwork (fixtures/van_gogh.html)' do
    let(:sample_html) do
      read_fixture('van_gogh.html')
    end

    subject(:parser) { described_class.new(sample_html) }
    
    let(:result) { parser.extract_artwork }

    it 'returns artworks' do
      expect(result).to be_an(Array)
      
    end

    it 'artwork contains all required fields' do
      first_artwork = result.first
      
      expect(first_artwork).to have_key(:name)
      expect(first_artwork).to have_key(:extensions)
      expect(first_artwork).to have_key(:link)
      expect(first_artwork).to have_key(:image)
    end

    it 'returns first artworks with title Portrait of Adeline Ravoux and all correct fields' do
      first_artwork = result.first
      
      expect(first_artwork[:name]).to eq('The Starry Night')
      expect(first_artwork[:extensions]).to eq(['1889'])
      expect(first_artwork[:link]).to eq('https://www.google.com/search?sca_esv=8a18c8f55351fc4a&sxsrf=ADLYWIJBe-2UhUBH0VuQ3QosT0SRFM1NBg:1734051631580&q=The+Starry+Night&stick=H4sIAAAAAAAAAONgFuLQz9U3MI_PNVLiBLFMzC3jC7WUspOt9Msyi0sTc-ITi0qQmJnFJVbl-UXZxYtYBUIyUhWCSxKLiioV_DLTM0oAdKX0-E4AAAA&sa=X&ved=2ahUKEwiS2ZbcxaOKAxXNG9AFHS0SBP0Qtq8DegQINBAD')
      expect(first_artwork[:image]).to eq('data:image/jpeg;base64,')     
    end
  end 
end 
